import React, { useState } from 'react';
import axios from 'axios';

const MocionForm = ({ onMocionAdded }) => {
    const [formData, setFormData] = useState({
        Topico: '',
        Tiempo_Del: '',
        Cant_Del: '',
        Tiempo_Total: '',
        Sesion: '',
        Fecha: ''
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:8080/mociones', formData);
            onMocionAdded(response.data);
        } catch (error) {
            console.error('Error al crear la moción:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" name="Topico" onChange={handleChange} placeholder="Tópico" />
            <input type="number" name="Tiempo_Del" onChange={handleChange} placeholder="Tiempo por Delegado" />
            <input type="number" name="Cant_Del" onChange={handleChange} placeholder="Cantidad de Delegados" />
            <input type="number" name="Tiempo_Total" onChange={handleChange} placeholder="Tiempo Total" />
            <input type="text" name="Sesion" onChange={handleChange} placeholder="Sesión" />
            <input type="date" name="Fecha" onChange={handleChange} />
            <button type="submit">Agregar Moción</button>
        </form>
    );
};

export default MocionForm;
